-- ----------------------------
-- Function structure for GET_PRODUCT_ID
-- ----------------------------
CREATE OR REPLACE
FUNCTION "INVENTORY"."GET_PRODUCT_ID" AS
BEGIN
	FOR X IN (SELECT * FROM "PRODUCT") LOOP
		IF UPPER(X.P_NAME) = UPPER(PNAME) THEN
			RETURN X.P_ID;
		END IF;
	END LOOP;
	RETURN 0;
END;
/

-- ----------------------------
-- Function structure for UPDATE_CHARGES
-- ----------------------------
CREATE OR REPLACE
FUNCTION "INVENTORY"."UPDATE_CHARGES" AS
BEGIN
	SELECT "LAST_UPDATED_ON", "DAILY_CHARGE", "DUE" INTO DATE1, DC, PRV_DUE
	FROM "CHARGES" WHERE "P_ID" = PID;
	D := SYSDATE - DATE1;
	CUR_DUE := D*DC + PRV_DUE;
	
	FOR X IN (SELECT * FROM "PRODUCT") LOOP
		IF X."P_ID" = PID THEN
			UPDATE "CHARGES" SET "DAILY_CHARGE" = X."REMAINING_ITEM" * X."PER_UNIT_CHARGE", "DUE" = CUR_DUE, "LAST_UPDATED_ON" = SYSDATE WHERE "P_ID" = X."P_ID";
			RETURN 1;
		END IF;
	END LOOP;
	RETURN 0;
END;
/

-- ----------------------------
-- Function structure for UPDATE_PER_UNIT_CHARGE
-- ----------------------------
CREATE OR REPLACE
FUNCTION "INVENTORY"."UPDATE_PER_UNIT_CHARGE" AS
BEGIN
    FOR X IN (SELECT "P"."P_ID" "P_I_D", "P"."TYPE" "PT","P"."PER_UNIT_CHARGE" "PUC", "S"."P_SIZE(CC)" "SIZE", "S"."PREFERRED_TEMP(C)" "TEMP" FROM "PRODUCT" "P" JOIN "SUPPLIES" "S" ON "P"."P_ID" = "S"."P_ID")
    LOOP
        IF(X."P_I_D" = PID) THEN
            FOR Y IN (SELECT * FROM "STORAGE") LOOP
								IF(X."PT" = Y."TYPE" AND (X."TEMP" BETWEEN Y.MIN_TEMP AND Y.MAX_TEMP)) THEN
										NPUC := X."SIZE" * Y.PER_VOL_COST;
										UPDATE "PRODUCT" SET "STORAGE_ID" = Y.ST_ID, PER_UNIT_CHARGE = NPUC WHERE P_ID = PID;
										RETURN 0;
								END IF; 
						END LOOP;
        END IF;
    END LOOP;
    RETURN -1;
END;
/

